import 'dart:convert';Map<String, User> userFromJson(String str) => Map.from(json.decode(str)).map((k, v) => MapEntry<String, User>(k, User.fromJson(v)));class User {  String name;  String profile;  double time;  User({    required this.name,    required this.profile,    required this.time,  });    factory User.fromJson(Map<String, dynamic> json) => User(    name: json["name"],    profile: json["profile"],    time: json["time"],  );}